import React from 'react';

interface Props {
    key: string,
    title: string,
    subtitle: string,
    overviewText: string,
    overviewOptions: {},
    recommendationsText: string,
    recommendationsOptions: {},
    videoUrl: string,
};

const Step: React.SFC<Props> = (...props) => (
    <div>
        <h4>Step { key }</h4>
        <h2>{ title }</h2>

    </div>
);

export default Step;
